import React from 'react';

function Card({ ticket }) {
    return (
        <div className="card">
          <h3>{ticket.title}</h3>
          <p>ID: {ticket.id}</p>
          {ticket.tags && (
            <p>Tags: {ticket.tags.join(', ')}</p>
          )}
          <p>User ID: {ticket.userId}</p>
          <p>Priority: {ticket.priority}</p>
          <p>Status: {ticket.status}</p>
        </div>
      );
}

export default Card;
